import React from "react";
import linkedin from './linkedin.jfif';

const FooterPage = () => {
    return (
        <div class="d-flex flex-column">
            <footer class="footer">
                <div>
                    <a href="www.linkedin.com/in/anthony-considine-03486056/" ><img src={linkedin} class="rounded float-left"></img></a>
                    <span>&copy; 2021 AnthonyConsidine</span>
                </div>
            </footer>
        </div>
    );
}

export default FooterPage;
